import React from 'react';
import { Container } from './styles';
export default function Comparativo(){
    return (
        <Container>
            <table>
                <tr>
                    <td>John</td>
                    <td>Doe</td>
                </tr>
                <tr>
                    <td>Jane</td>
                    <td>Does</td>
                </tr>
            </table>
        </Container>
    );
}
